        mHdltvoutHandle << " , " <<  " \"cnn_input_Din_A\" :  \"" << cnn_input_Din_A.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"cnn_input_Dout_A\" :  \"" << cnn_input_Dout_A.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"cnn_input_Clk_A\" :  \"" << cnn_input_Clk_A.read() << "\" ";
